// Action types
export const SET_PRODUCTS = "SET_PRODUCTS";
export const SET_FILTER = "SET_FILTER";

// Action creators
export const setProducts = (products) => ({
  type: SET_PRODUCTS,
  payload: products
});

export const setFilter = (filter) => ({
  type: SET_FILTER,
  payload: filter
});
